// src/App.js
import React from 'react';
import './App.css';
import Inventory from './Inventory';
import Login from './Login';
import LabelPrinter from './LabelPrinter'; // Import other components as needed
import { Container } from '@mui/material';

function App() {
    return (
        <Container>
            <Login />
            <div style={{ margin: '40px 0' }} /> {/* Add space between components */}
            <Inventory />
            <LabelPrinter />
        </Container>
    );
}

export default App;
